import React from "react";
import Menu from "./Menu.js";
import { Routes, Route } from "react-router-dom";
const Home = () => {
  return (
    <div>
      <h1>Home Page</h1>
      <Routes>
        <Route path="/page1" element={<h1>Page1</h1>} />
      </Routes>
    </div>
  );
};

export default Home;
